import React from 'react'
import {Element} from 'react-scroll'
import Project from '../Project/Project';
const ProjectContainer = () => {
    const projects=[
        {img: "https://images.unsplash.com/photo-1611224885990-ab7363d1f2a9?q=80&w=1939&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D",
        title: "Web Page Builder Using HTML, CSS, JavaScript an PHP",
        desc:"This Web Application is very simple to the  User can just Drag and Drop the Layouts and Template to Create a Web Site",
        link:"www.google.com",
        },
    {
        img: "https://images.unsplash.com/photo-1611224885990-ab7363d1f2a9?q=80&w=1939&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D",
        title: "A PDF Text Reader Using Pyton ",
        desc:"The PDF reader Using TKinter and PYPDF Libraries and User can adjust the no of lines and changes speaker",
        link:"www.google.com",
},
    {
        img: "https://images.unsplash.com/photo-1611224885990-ab7363d1f2a9?q=80&w=1939&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D",
        title: "A Multi Label Text Classification Using Python",
        desc:"Predict the title for the relevant articles Using the Machine Learning Model Relu",
        link:"www.google.com",
},
    {
        img: "https://images.unsplash.com/photo-1611224885990-ab7363d1f2a9?q=80&w=1939&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D",
        title: "Diabetes Prediction Using Python",
        desc:"Make Predict Diabetes and Deployed in Ms Azure Cloud",
        link:"www.google.com",
    },
   {
        img: "https://images.unsplash.com/photo-1611224885990-ab7363d1f2a9?q=80&w=1939&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D",
        title: "Portfolio Web Page Using HTML, CSS, Javascript and React",
        desc:"Portfolio desscribes about the skills, Projects and Experience",
        link:"www.google.com",
   },];
    
  return (
    <Element className="projectContainer" id='projects'>
        <h1>Projects</h1>
        <p>Here are some projects which I have done.</p>
        <div className='projectsContainer__projects'>
{projects.map((project, index)=> {
        return(
            <Project key={index} img={project.img} title={project.title} desc={project.desc} link={project.link} />
        );
    })
}
        </div>
    </Element>
  );
};

export default ProjectContainer
